INSERT INTO `cms` (`id`, `name`, `type`, `body`, `sub_description`, `attached`, `link`, `status`, `modified_date`) VALUES
(1, 'About Us', 'aboutus', '<h1><strong>About Officeyew</strong></h1>\r\n\r\n<p>We wanted to create the largest &ldquo;One stop shop&rdquo; for everything office furniture. We created officeyew to help make buying and selling of office furniture easy , by making it quicker, simpler, and more fun - and with over million of downloads and millions of listings each year, not only is Officeyew the only office furniture specific app of its kind, it is also the fastest growing office furniture marketplace in the USA or World. Listing what you do not need with the snap of a photo and finding what you want anywhere in the USA does not just help you buy and sell more - it helps you live more. (Plus, its easy and free, everyone loves free) Selling on Officeyew is effortless, making it easy to post free classified ads and browse new and used goods for sale. Officeyew will be the &ldquo;The one stop shop&rdquo; for everything Office Furniture. Not only can you buy and sell office furniture, you can find and installer, find a designer and look for employment or an employee.</p>\r\n\r\n<p>So what are you waiting for? It is time for yew to make some money for your products you do not need.&nbsp;</p>\r\n\r\n<h2><br />\r\n<strong>Post in a snap</strong></h2>\r\n\r\n<p>Selling something should be as painless as it was to buy it in the first place. We balance advanced tech with intuitive design, so Officeyew&rsquo;s got it where it counts and selling feels totally effortless. Post your listing for free on the Officeyew marketplace to get it in front of buyers near you. Use Officeyew&rsquo;s in-app online chat to negotiate with buyers and make deals. You can also get multiple quotes from Installers and Commercial interior designers in your area. Not to mention that it is the central hub for people in the industry to search for employment and find employees.</p>\r\n\r\n<p>We are here to help: If you have those products that are gathering dust in a storage unit, or you moving to a new location and have multiple floors of furniture you need to get rid of. Take a picture of it, post it on Officeyew and see how good it feels to make your first sale to someone who would not otherwise be able to afford it. When you have a position open and you see all those who are looking for employment, how rewarding would it be to help someone find a new career or find a new career in a marketplace where everyone is in the same industry.</p>\r\n\r\n<h2><br />\r\n<strong>Find whatever you need</strong></h2>\r\n\r\n<p>There is a secret economy right in your area, and Officeyew is your ticket in. Find deals on whatever you need all locally on Officeyew: from new and used workstations, desks, height adjustable tables, task chairs and home office packages, thousands of classified ads are posted every day so you can find and buy exactly what you&#39;re looking for.</p>\r\n\r\n<p>Filter by location down to products within a mile. Sort by category or price. Search for product, age, brand. Why not look and see what you can find? You never know what is available right around the corner from you. Literally.&nbsp;</p>\r\n\r\n<h2><br />\r\n<strong>More than an app</strong></h2>\r\n\r\n<p>Officeyew is an Android and iOS app first and foremost, but that is not it! Different strokes for different folks, so you can also use our website to buy and sell, if that is what you prefer. Log in to the site to post online classifieds, search for new or used items, or connect with buyers and sellers in your neighborhood through chat.&nbsp;</p>\r\n\r\n<h2><br />\r\n<strong>Buy and sell safely</strong></h2>\r\n\r\n<p>We know that Officeyew makes it easier than ever to find great deals in your area. And we love that! (It is literally why we exist.) But we are also dedicated to making sure our marketplace is not just easy to use, but easy to use safely. That is why we offer features like user verification and in-app chat so you can connect with confidence with no soliciting.&nbsp;</p>\r\n\r\n<p>Listing the things you need to get rid of or update and finding deals on what you want right in your area helps you get the most out of your office furniture and out of life, and we&rsquo;re committed to making it fun, easy, and safe for you to carry on doing the things that are more important.&nbsp;</p>\r\n\r\n<h2><br />\r\n<strong>Why Officeyew</strong></h2>\r\n\r\n<p>We are allowing you to make money on those products you have usually sold for 10 cents on the dollar. As the saying goes&rdquo; One man&rsquo;s trash is another man&rsquo;s treasure&rdquo; Because happiness isn&rsquo;t about having MORE money - it&rsquo;s about getting the correct value for something of worth. It is about turning something that you no longer use into money. And that can be true about anything you wish to sell.&nbsp;</p>\r\n\r\n<p>We are unlocking a secret office furniture economy where sellers can feel the freedom to sell and buyers can get the things, they thought they could not usually afford. We are making it easier for people to get the things they need to start a home office, new business, new career or added items they need to fill a space. At the same time, they can live the life they want, while reducing waste going to our landfills and cutting down on carbon emissions.&nbsp;</p>\r\n\r\n<p>Take a good look at the products and accessories you thinking of discarding: what would you turn them into? Sure, thanking your old things for their service and tossing them feels liberating &ndash; but by selling them to someone on Officeyew who will really loves them or needs them, everybody wins!&nbsp;</p>\r\n\r\n<p>So, investigate the largest window into the office furniture world and see how you can make a difference!</p>\r\n', ' ', '', '', 1, 1601436203),
(2, 'Who We Are', 'who_we_are', '<h2>Who we are?</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'What is Lorem Ipsum?\r\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of ', '', '', 1, 1611615112),
(3, 'How We Work', 'how_we_work', '<h1><strong>How Officeyew Works:</strong></h1>\r\n\r\n<ul>\r\n	<li>Officeyew has 5 different application on the marketplace all tied to the office furniture industry. If you want to use the website or app for any of the applications, you need register and establish a login. The first application allows you to buy and sell office furniture or accessories. By simply taking a few pictures with your phone or camera you can download them to the app/website, give a brief description, set a price you are ready to sell (Yes, it is that simple). Buyers searching on Officeyew can message you through the officeyew messaging system if they would like to purchase. Transactions are done through the site giving both buyer and seller the confidence that they not being scammed.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The second application would be to find an installer or and installation company for those looking to have furniture picked up, moved and installed. Everyone who&rsquo;s registered will be directed to a drop-down box where they would designate the way they would like to be viewed on the site. If someone is looking for an installer, they would scroll down to the Search an Installer button where they would fill in a brief questionnaire, submit it and it would be sent out to all installers in the area to bid on. Once they have submitted their bid, the person looking for an installer will get multiple responses from which they can choose their preference.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The third application would be to find a freelance interior designer, Cad Designer or Commercial Interior design firm. Company&rsquo;s or individuals looking to get furniture layouts, design ideas or to cover a full furniture project have would scroll down to the Search a Designer button where they would fill in a brief questionnaire, submit it and it would be sent out to all designers or interiors design companies in the area to bid on. Once they have submitted their bid, the person looking for a designer will get multiple responses from which they can chose their preference.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The 4th application on the Officeyew marketplace would be for individuals looking for employment or companies looking to post a job for an opening they may have. Anyone can post their resume on the site with privacy and &ldquo;it&rsquo;s free&rdquo;, yes that is correct free. At the same time companies can post a job opening and search for individuals in the marketplace who are searching for employment and meet the criteria they are looking for.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The 5th application would be for an office furniture company or an individual who would usually only get local exposure and wants a gain national exposure with a wider audience. They can post products on the site. These sellers have a couple of options to help them get that additional exposure. The first would be to do a monthly subscription called Yew Promote +. This is a monthly/yearly subscription which allows the seller to add their products to the deals of the day section and get them posted higher up in the category section. For Yew Promote + the seller can do 4 items each month as long as they pay for the subscription. Then you get Yew + which is a onetime purchase for someone who just wants to promote a product for a week in the category section in their area. This would not be in the Deals of the week section.</li>\r\n</ul>\r\n', ' ', '', '', 1, 1601057568),
(4, 'Work With Us', 'work_with_us', '<h2>Where can I get some?</h2>\r\n\r\n<p>&nbsp;</p>\r\n', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.', '', '', 1, 1611615157),
(5, 'Terms and Condition', 'terms_condition', '<p>April 2nd, 2020<br />\r\nWelcome to the Officeyew website! Please read these Terms of Service (the &ldquo;Agreement&rdquo;) carefully. Your use of the Officeyew app and/or website constitutes your consent to this Agreement.<br />\r\nThis Agreement is between you and Officeyew LLC. concerning your use of or access to the Officeyew mobile application and the Officeyew website. Officeyew LLC is referred to in this Agreement as &ldquo;Company&rdquo; or &ldquo;we&rdquo; or &ldquo;us&rdquo;. The Officeyew mobile application, together with any successor app(s) will be referred to as the &ldquo;App&rdquo; and the Officeyew website currently located at www.officeyew.com, together with any successor website, will be referred to as the &ldquo;Site.&rdquo; Finally, this Agreement refers to the App and Site, together with any materials and services available therein, as the &ldquo;Service.&rdquo; Please note that this Agreement hereby incorporates by reference any additional terms and conditions we post through the Service or otherwise make available to you.<br />\r\nBY USING THE SERVICE, YOU AFFIRM THAT YOU ARE EITHER (1) OF LEGAL AGE TO ENTER INTO THIS AGREEMENT (WHICH IS 18 IN MOST STATES), OR, (2) AT LEAST 14 YEARS OLD AND THAT YOU HAVE OBTAINED PARENTAL OR GUARDIAN CONSENT TO ENTER INTO THIS AGREEMENT, AND THAT YOUR PARENT OR GUARDIAN HAS AGREED TO BE LIABLE FOR YOUR ACTS AND OMISSIONS.<br />\r\nTHIS AGREEMENT CONTAINS A MANDATORY ARBITRATION PROVISION THAT, AS FURTHER SET FORTH IN SECTION 19 BELOW, REQUIRES THE USE OF ARBITRATION ON AN INDIVIDUAL BASIS TO RESOLVE DISPUTES, RATHER THAN JURY TRIALS OR ANY OTHER COURT PROCEEDINGS, OR CLASS ACTIONS OF ANY KIND</p>\r\n\r\n<p><br />\r\n<strong>1. Information Submitted Through the Service</strong><br />\r\nYour submission of information through the Service is governed by Company&rsquo;s Privacy Policy&nbsp;https://officeyew.com/privacy-policy&nbsp;(the &ldquo;Privacy Policy&rdquo;). You represent and warrant that any information you provide in connection with the Service, including Listings and other Submissions (each, as defined below), is and will remain accurate and complete, and that you will maintain and update such information as needed.</p>\r\n\r\n<p><br />\r\n<strong>2. Community Guidelines.</strong><br />\r\nYou agree that you will comply with all of our Community Guidelines, as updated by us from time to time, located at&nbsp;https://officeyew.com/community-guidelines.&nbsp;The Community Guidelines contain, among other things, our list of prohibited products, prohibited services and our rules of conduct.</p>\r\n\r\n<p><br />\r\n<strong>3. Registration; Usernames and Passwords.</strong><br />\r\nYou may need to register to use all or part of the Service. We may reject, or require that you change, any username, password or other information that you provide to us in registering. Your username and password are your account credentials and must be kept confidential. You are responsible for any and all activity on any account you register using your account credentials. You must immediately notify us if you believe that your account credentials have been compromised. If you register using a social media network, you authorize us to access, use, disclose and retain, in accordance with our Privacy Policy, the information that we receive from the social media network in connection with your registration.</p>\r\n\r\n<p><br />\r\n<strong>4. Listings.</strong><br />\r\nThe Service includes a forum where users may post and browse listings for office furniture goods and accessories as well as installation, design and employment services (each a &ldquo;Listing&rdquo;). Such Listings are provided by users, and not by us. WE DO NOT SELL, RENT OR OTHERWISE MAKE AVAILABLE ANY GOODS, REAL ESTATE OR SERVICES. WE ARE NOT RESPONSIBLE OR LIABLE FOR ANY SUCH LISTINGS, FOR ANY TRANSACTIONS LISTINGS (EXCEPT AS SET FORTH IN THIS AGREEMENT) AND SUCH LISTINGS DO NOT CONSTITUTE AN OFFER FROM THE COMPANY. PLEASE USE CAUTION AND COMMON SENSE WHEN BUYING, SELLING, LEASING, HIRING OR OTHERWISE PARTICIPATING IN ANY TRANSACTION REGARDING A LISTING, OR MAKING OR RECEIVING PAYMENT FOR ANY LISTING.<br />\r\nThe availability or promotion of a Listing through the Service does not imply our endorsement of the Listing or the provider. We make no representations whatsoever about any Listings, or any users. Information about and the availability of any Listing are subject to change at any time without notice. You must ascertain and obey all applicable laws regarding the marketing, promotion, sale, purchase, delivery, receipt, possession and use of the subject of any Listing. We reserve the right to remove any Listing for any reason.<br />\r\nYou represent and warrant that you have the necessary authority and permissions to post any Listing, to enter into any transaction or to make any transfer relating to a Listing, including, if you are not of legal age to do so, by obtaining proper parental or guardian consent. The legal age is 18 in most states.</p>\r\n\r\n<p><br />\r\n<strong>5. Submissions.</strong><br />\r\nYou may submit information that could be used to personally identify you through Listings, the creation of profile pages, submissions in forums, connection via a social network, message boards, chat, comments, or various other interactive channels of the Service(each, a &ldquo;Submission&rdquo;). You are responsible for any Submission you make. We have no control over and are not responsible for any use or misuse (including any distribution) by any third party of your Submissions.</p>\r\n\r\n<p><br />\r\n<strong>6. License.</strong><br />\r\nYou retain ownership of your Submissions but for each Submission you make you hereby grant to us a worldwide, royalty-free, fully paid-up, non-exclusive, perpetual, irrevocable, transferable and fully sublicensable (through multiple tiers) license, without additional consideration to you or any third party, to reproduce, distribute, perform and display (publicly or otherwise), create derivative works of, adapt, modify and otherwise use, analyze and exploit each Submission, in any format or media now known or hereafter developed, and for any purpose (including promotional purposes, such as testimonials).<br />\r\nIn addition, if you provide to us any ideas, proposals, suggestions or other materials (&ldquo;Feedback&rdquo;), whether related to the Service or otherwise, such Feedback will be deemed a Submission, and you hereby acknowledge and agree that such Feedback is not confidential and that your provision of such Feedback is gratuitous, unsolicited and made without restriction, and does not create any obligation whatsoever by us.<br />\r\nYou represent and warrant that you have all right and title necessary to grant the licenses granted in this section, and that your Submissions, and your provision thereof through and in connection with the Service, are complete and accurate, and are not fraudulent, tortious or otherwise in violation of any applicable law or any right of any third party. You further irrevocably waive any &ldquo;moral rights&rdquo; or other rights with respect to attribution of authorship or integrity of materials regarding each Submission that you may have under any applicable law under any legal theory.</p>\r\n\r\n<p><br />\r\n<strong>7. Monitoring.</strong><br />\r\nWe may (but have no obligation to) monitor (either directly or using software), evaluate, alter or remove Submissions before or after they appear on the Service, or analyze your access to or use of the Service. Subject to our Privacy Policy, you agree that we may disclose any and all information regarding your access to and use of the Service to anyone for any reason or purpose.</p>\r\n\r\n<p><br />\r\n<strong>8. Featured Listings and Subscriptions.</strong><br />\r\nWe may provide certain enhanced features (such as the featuring your Listing in the feed) for a fee (&ldquo;Fees&rdquo;) in connection with the Service (&ldquo;Paid Services&rdquo;). All Fees are set out and described in the App and are denominated in U.S. dollars and are exclusive of any applicable taxes. Payments are processed through the Google Play or iTunes app store from which you originally downloaded the App. You may access the applicable &ldquo;in-app&rdquo; purchase rules and policies directly from the app stores. All billing and refund inquiries must be directed to the applicable app store. Delivery of the Paid Services is provided immediately upon purchase.<br />\r\nCertain of the Paid Services may be offered on a subscription basis with auto-renewing payments (&ldquo;Subscription Services&rdquo;). The billing period for each type of subscription service will be as specified in the App or Site at the time of purchase. You can manage your subscriptions from your account in the Google Play or iTunes app store. To cancel any Subscription Service, you must submit your cancellation through the applicable app store. You must cancel a Subscription Service before the start of the next billing period in order to avoid charges for the next billing period&rsquo;s fees. Following any cancellation, you will continue to have access to the Subscription Services through the end of your current billing period and then the Subscription Service will terminate automatically. If you delete the app or the account on which the subscription was applied, the subscription will be fully consumed, even if it is time-dependent and the billing period has not elapsed.<br />\r\nWe reserve the right to modify the Fees from time to time in our sole discretion. Any changes in the Fees will apply to the next billing period. Except as provided above, or as otherwise expressly agreed upon by us, all sales of Paid Services (including any Subscription Services) are final and there are no refunds. There are no refunds or credits for partially used Subscription Services periods.</p>\r\n\r\n<p><br />\r\n<strong>9. Payments Through Officeyew.</strong><br />\r\nWhere available, a buyer and seller may pay with and accept credit cards and other electronic payment methods (each an &ldquo;Electronic Payment Method&rdquo;) through the Service. Use of an Electronic Payment Method is subject to the terms and conditions of such third-party providers (such as Apple through Apple Pay). Officeyew, in its sole discretion, may from time to time impose limits on your ability to make and/or receive payments through the Officeyew Payments. Additionally, third parties may impose their own limits and limitations on a seller&rsquo;s use of the Officeyew Payments.<br />\r\nAll purchases made using Officeyew Payments are made directly between the buyer and the seller when they complete their purchase and sale transaction, pursuant to the terms they determine. We are not a party to purchase and sale transactions completed using Officeyew Payments, and disclaims any and all responsibility to facilitate such transactions, except to provide an interface through which you can provide your Electronic Payment Method to a third party to process on behalf of the seller. By releasing payment to the seller, the buyer confirms that they are in possession of the item, have inspected it, and that the item is acceptable. You agree to pay the service fees (&ldquo;Service Fees&rdquo;) described in the FAQs for the sales transactions you make using Officeyew Payments. The Service Fees include Electronic Payment Method processing fees to officeyew&rsquo;s payment processor and service fees to Officeyew. We reserve the right to change the Service Fees from time to time.<br />\r\nWe are not liable for funds held within a seller&rsquo;s account, should they not provide us with payout information (or provide us with incorrect payment information). We are not responsible for an incorrect payout that results in a successful, irretrievable payout to a third party as the result of your providing incorrect information.<br />\r\nUpon completion of a sale in which the buyer uses Officeyew Payments, if you have not previously set up an account with the payments provider, then you must do so in accordance with their specified requirements. Your right and/or ability to receive sales proceeds via Officeyew Payments may be revoked, disabled or limited if the purchase or sale violates this Agreement. It is your responsibility to determine what, if any, taxes apply to each transaction you complete via the Service, including, for example, sales, use, value added, and similar taxes. It is also your responsibility to withhold, collect, report and remit the correct taxes to the appropriate tax authorities. We are not responsible for withholding, collecting, reporting, or remitting any sales, use, value added, or similar tax arising from any transaction you complete via the Service.<br />\r\nOffers may be canceled by us for any reason prior to a buyer releasing their payment to a seller. We cannot provide protection or support for payments released to a seller before the buyer has possession of the item. Any decision made by Officeyew regarding resolving a dispute is final and binding.</p>\r\n\r\n<p><br />\r\n<strong>10. Your Limited Rights.</strong><br />\r\nThe App is licensed (not sold) to end users. Subject to your compliance with this Agreement, and solely for so long as you are permitted by Company to use the App, we hereby permit you, on a limited, non-exclusive, revocable, non-transferable, non-sublicensable basis, to install and use the App on a mobile device that you own or control, solely for your use. If you fail to comply with any of the terms or conditions of this Agreement, (i) you must immediately cease using the App, (ii) you must remove (that is, uninstall and delete) the App from your mobile device and (iii) you are prohibited from using the App on any mobile device until such time as we grant you explicit permission to use the App again. Please note that if you do not accept the system permissions that the App requires from time to time, you may not be able to use the App or certain of its functionalities. You are responsible for obtaining, maintaining and paying for all hardware and all telecommunications and other services needed to use the Service.<br />\r\nIn addition, subject to your compliance with this Agreement, and solely for so long as you are permitted by Company to use the Site, you may view one (1) copy of any portion of the Site to which we provide you access under this Agreement, on any single device, solely for your personal, non-commercial use.</p>\r\n\r\n<p><br />\r\n<strong>11.&nbsp;Company&rsquo;s Proprietary Rights.</strong><br />\r\nWe own the Service, which is protected by proprietary rights and laws. Our trade names, trademarks and service marks include Officeyew and any associated logos. All trade names, trademarks, service marks and logos on the Service not owned by us are the property of their respective owners. You may not use our trade names, trademarks, service marks or logos in connection with any product or service that is not ours, or in any manner that is likely to cause confusion. Nothing contained on the Service should be construed as granting any right to use any trade names, trademarks, service marks or logos without the express prior written consent of the owner.</p>\r\n\r\n<p><br />\r\n<strong>12. Third Party Materials.</strong><br />\r\nThough your use of the Service, you may have access to certain information, products, services and other materials made available by third parties, including Listings and other Submissions (&ldquo;Third Party Materials&rdquo;), or allow for the routing or transmission of such Third Party Materials.<br />\r\nWe do not control or endorse, and are not responsible for, any Third Party Materials and make no representations or warranties about them. We may not monitor Third Party Materials, and we may block or disable access to any Third-Party Materials through the Service at any time. The availability of any Third Party Materials through the Service does not imply our endorsement of, or our affiliation with, any provider of Third Party Materials.<br />\r\nYOU USE THIRD PARTY MATERIALS AT YOUR OWN RISK AND IS SUBJECT TO ANY ADDITIONAL TERMS OR POLICIES APPLICABLE TO SUCH THIRD PARTY MATERIALS (SUCH AS TERMS OF SERVICE OR PRIVACY POLICIES OF THE PROVIDERS OF SUCH THIRD PARTY MATERIALS).</p>\r\n\r\n<p><br />\r\n<strong>13. Promotions.</strong><br />\r\nAny sweepstakes, contests, raffles, surveys, games or similar promotions (collectively, &ldquo;Promotions&rdquo;) made available through the Service may be governed by rules that are separate from this Agreement. If you participate in any Promotions, please review the applicable rules. If the rules for a Promotion conflict with this Agreement, the Promotion rules will govern.</p>\r\n\r\n<p><br />\r\n<strong>14. Disclaimer of Warranties.</strong><br />\r\nTO THE FULLEST EXTENT PERMITTED UNDER APPLICABLE LAW: (A) THE SERVICE AND ANY THIRD PARTY MATERIALS ARE MADE AVAILABLE TO YOU BY US ON AN &ldquo;AS IS,&rdquo; &ldquo;WHERE IS&rdquo; AND &ldquo;WHERE AVAILABLE&rdquo; BASIS, WITHOUT ANY WARRANTIES BY COMPANY OF ANY KIND, WHETHER EXPRESS, IMPLIED OR STATUTORY; AND (B) COMPANY DISCLAIMS ALL WARRANTIES WITH RESPECT TO THE SERVICE AND ANY LISTINGS AND THIRD PARTY MATERIALS, INCLUDING THE WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, NON-INFRINGEMENT AND TITLE. ALL DISCLAIMERS OF ANY KIND (INCLUDING IN THIS SECTION AND ELSEWHERE IN THIS AGREEMENT) ARE MADE FOR THE BENEFIT OF BOTH COMPANY AND ITS AFFILIATES AND THEIR RESPECTIVE SHAREHOLDERS, DIRECTORS, OFFICERS, EMPLOYEES, AFFILIATES, AGENTS, REPRESENTATIVES, LICENSORS, SUPPLIERS AND SERVICE PROVIDERS (COLLECTIVELY, THE &ldquo;AFFILIATED ENTITIES&rdquo;), AND THEIR RESPECTIVE SUCCESSORS AND ASSIGNS.<br />\r\nWe do not guarantee that the Service is or will remain available updated, complete, correct, secure, or that access to the Service will be uninterrupted. The Service may include inaccuracies, errors, and materials that violate or conflict with this Agreement. Additionally, third parties may make unauthorized alterations to the Service. If you become aware of any such alteration, contact us at info@letgo.com with a description of such alteration and its location on the Service.</p>\r\n\r\n<p><br />\r\n<strong>15. Limitation of Liability.</strong><br />\r\nTO THE FULLEST EXTENT PERMITTED UNDER APPLICABLE LAW: (A) COMPANY WILL NOT BE LIABLE FOR ANY INDIRECT, INCIDENTAL, CONSEQUENTIAL, SPECIAL, EXEMPLARY OR PUNITIVE DAMAGES OF ANY KIND, UNDER ANY CONTRACT, TORT (INCLUDING NEGLIGENCE), STRICT LIABILITY OR OTHER THEORY, INCLUDING DAMAGES FOR LOSS OF PROFITS, USE OR DATA, LOSS OF OTHER INTANGIBLES, LOSS OF SECURITY OF SUBMISSIONS (INCLUDING UNAUTHORIZED INTERCEPTION BY THIRD PARTIES OF ANY SUBMISSIONS), EVEN IF ADVISED IN ADVANCE OF THE POSSIBILITY OF SUCH DAMAGES OR LOSSES; (B) WITHOUT LIMITING THE FOREGOING, COMPANY WILL NOT BE LIABLE FOR DAMAGES OF ANY KIND RESULTING FROM YOUR USE OF OR INABILITY TO USE THE SERVICE OR FROM ANY LISTINGS OR TRANSACTIONS OR TRANSFERS RELATING TO LISTINGS, OR FROM ANY THIRD PARTY MATERIALS, INCLUDING FROM ANY DISPUTE WITH ANY OTHER USER OF THE SERVICE; (C) YOUR SOLE AND EXCLUSIVE REMEDY FOR DISSATISFACTION WITH THE SERVICE OR ANY THIRD PARTY MATERIALS IS TO STOP USING THE SERVICE; AND (D) THE MAXIMUM AGGREGATE LIABILITY OF COMPANY FOR ALL DAMAGES, LOSSES AND CAUSES OF ACTION, WHETHER IN CONTRACT, TORT (INCLUDING NEGLIGENCE) OR OTHERWISE, SHALL BE THE GREATER OF (I) THE TOTAL AMOUNT, IF ANY, PAID BY YOU TO COMPANY TO USE THE SERVICE, AND (II) TWENTY-FIVE U.S. DOLLARS ($25.00). ALL LIMITATIONS OF LIABILITY OF ANY KIND (INCLUDING IN THIS SECTION AND ELSEWHERE IN THIS AGREEMENT) ARE MADE FOR THE BENEFIT OF BOTH COMPANY AND THE AFFILIATED ENTITIES, AND THEIR RESPECTIVE SUCCESSORS AND ASSIGNS.</p>\r\n\r\n<p><br />\r\n<strong>16. Indemnity.</strong><br />\r\nTo the fullest extent permitted under applicable law, you agree to defend, indemnify and hold harmless Company and the Affiliated Entities, and their respective successors and assigns, from and against all claims, liabilities, damages, judgments, awards, losses, costs, expenses and fees (including attorneys&rsquo; fees) arising out of or relating to (a) your use of, or activities in connection with, the Service (including all Submissions); (b) any Listings, transactions or transfers relating to Listings, or disputes with other users of the Service; and (c) any violation or alleged violation of this Agreement by you.</p>\r\n\r\n<p><br />\r\n<strong>17. Termination.</strong><br />\r\nThis Agreement is effective until terminated. The company may terminate or suspend your use of the Service at any time and without prior notice, for any or no reason. Upon any such termination or suspension, your right to use the Service will immediately cease, and Company may take technical and/or other measures to block your access to the Service. Sections [2&ndash;3, 9, 12&ndash;13 and 15&ndash;24] shall survive any expiration or termination of this Agreement.</p>\r\n\r\n<p><br />\r\n<strong>18. Governing Law; Arbitration.</strong><br />\r\nThe terms of this Agreement are governed by the laws of the United States (including federal arbitration law) and the State of California, without regard to its principles of conflicts of law, and regardless of your location. EXCEPT FOR DISPUTES THAT QUALIFY FOR SMALL CLAIMS COURT, ALL DISPUTES ARISING OUT OF OR RELATED TO THIS AGREEMENT OR ANY ASPECT OF THE RELATIONSHIP BETWEEN YOU AND COMPANY, WHETHER BASED IN CONTRACT, TORT, STATUTE, FRAUD, MISREPRESENTATION OR ANY OTHER LEGAL THEORY, WILL BE RESOLVED THROUGH FINAL AND BINDING ARBITRATION BEFORE A NEUTRAL ARBITRATOR INSTEAD OF IN A COURT BY A JUDGE OR JURY AND YOU AGREE THAT COMPANY AND YOU ARE EACH WAIVING THE RIGHT TO TRIAL BY A JURY. EXCEPT AS PROVIDED BELOW REGARDING THE CLASS ACTION WAIVER, SUCH DISPUTES INCLUDE, WITHOUT LIMITATION, DISPUTES ARISING OUT OF OR RELATING TO INTERPRETATION OR APPLICATION OF THIS ARBITRATION PROVISION, INCLUDING THE ENFORCEABILITY, REVOCABILITY OR VALIDITY OF THE ARBITRATION PROVISION OR ANY PORTION OF THE ARBITRATION PROVISION. ALL SUCH MATTERS SHALL BE DECIDED BY AN ARBITRATOR AND NOT BY A COURT OR JUDGE. HOWEVER, AS SET FORTH BELOW, THE PRECEDING ARBITRATION REQUIREMENT SHALL NOT APPLY TO DISPUTES TO THE EXTENT RELATING TO THE INTERPRETATION OR APPLICATION OF THE CLASS ACTION WAIVER BELOW, INCLUDING ITS ENFORCEABILITY, REVOCABILITY OR VALIDITY.<br />\r\nYOU AGREE THAT ANY ARBITRATION UNDER THIS AGREEMENT WILL TAKE PLACE ON AN INDIVIDUAL BASIS; CLASS ARBITRATIONS AND CLASS ACTIONS ARE NOT PERMITTED AND YOU ARE AGREEING TO GIVE UP THE ABILITY TO PARTICIPATE IN A CLASS ACTION. Notwithstanding anything to the contrary in this Section or any other provision of this Agreement or in the American Arbitration Association&rsquo;s Consumer Arbitration Rules, disputes regarding the enforceability, revocability or validity of the foregoing class action waiver may be resolved only by a civil court of competent jurisdiction and not by an arbitrator. In any case in which (1) the dispute is filed as a class, collective, or representative action, and (2) there is a final judicial determination that all or part of such class action waiver is unenforceable, then the class, collective, and/or representative action, to that extent, must be litigated in a civil court of competent jurisdiction, but the portion of such class action waiver that is enforceable shall be enforced in arbitration.<br />\r\nThe arbitration will be administered by the American Arbitration Association under its Consumer Arbitration Rules, as amended by this Agreement. The Consumer Arbitration Rules are available online&nbsp;https://www.adr.org/consumer. The arbitrator will conduct hearings, if any, by teleconference or videoconference, rather than by personal appearances, unless the arbitrator determines upon request by you or by us that an in-person hearing is appropriate. Any in-person appearances will be held at a location which is reasonably convenient to both parties with due consideration of their ability to travel and other pertinent circumstances. If the parties are unable to agree on a location, such determination should be made by the AAA or by the arbitrator. The arbitrator&rsquo;s decision will follow the terms of this Agreement and will be final and binding. The arbitrator will have authority to award temporary, interim or permanent injunctive relief or relief providing for specific performance of this Agreement, but only to the extent necessary to provide relief warranted by the individual claim before the arbitrator. The award rendered by the arbitrator may be confirmed and enforced in any court having jurisdiction thereof. Notwithstanding any of the foregoing, nothing in this Agreement will preclude you from bringing issues to the attention of federal, state or local agencies and, if the law allows, they can seek relief against us for you.</p>\r\n\r\n<p><br />\r\n<strong>19. Information or Complaints.</strong><br />\r\nIf you have a question or complaint regarding the Service, please send an e-mail to info@officeyew.com. You may also contact us by writing to 1 Serena Court, Newport Beach, CA, or by calling us at 800-234-1971. Please note that e-mail communications will not necessarily be secure; accordingly, you should not include credit card information or other sensitive information in your e-mail correspondence with us. California residents may reach the Complaint Assistance Unit of the Division of Consumer Services of the California Department of Consumer Affairs by mail at 1625 North Market Blvd., Sacramento, CA 95834, or by telephone at (916) 445-1254 or (800) 952-5210.</p>\r\n\r\n<p><br />\r\n<strong>20. Copyright Infringement Claims.</strong><br />\r\nThe Digital Millennium Copyright Act of 1998 (the &ldquo;DMCA&rdquo;) provides a process for copyright owners who believe that material appearing on the Internet infringes their rights under U.S. copyright law. If you believe in good faith that materials available on the Service infringe your copyright, you (or your agent) may send the Company a written notice by mail, e-mail or fax, requesting that the Company remove or block access to such material. If you believe in good faith that someone has wrongly filed a notice of copyright infringement against you, the DMCA permits you to send to Company a counter-notice. Notices and counter-notices must meet the statutory requirements imposed of the DMCA. See&nbsp;http://www.copyright.gov/&nbsp;for details. Notices and counter-notices must be sent in writing to our DMCA Agent as follows: By mail to Officeyew DMCA Agent, 1 Serena Court, Newport Beach, CA 92663; by e-mail to copyright@officeyew.com; or by phone number to 800-234-1971.<br />\r\nWe suggest that you consult your legal advisor before filing a DMCA notice or counter-notice.</p>\r\n\r\n<p><br />\r\n<strong>21. Export Controls.</strong><br />\r\nYou are responsible for complying with United States export controls and for any violation of such controls, including any United States embargoes or other federal rules and regulations restricting exports. You represent, warrant and covenant that you are not (a) located in, or a resident or a national of, any country subject to a U.S. government embargo or other restriction, or that has been designated by the U.S. government as a &ldquo;terrorist supporting&rdquo; country; or (b) on any of the U.S. government lists of restricted end users.</p>\r\n\r\n<p><br />\r\n<strong>22. Jurisdictional Issues.</strong><br />\r\nThe Service is controlled or operated (or both) from the United States and is not intended to be subject Company to any non-U.S. jurisdiction or law. The Service may not be appropriate or available for use in some non-U.S. jurisdictions. We may limit the Service&rsquo;s availability at any time, in whole or in part, to any person, geographic area or jurisdiction that we choose.</p>\r\n\r\n<p><br />\r\n<strong>23. Changes.</strong><br />\r\nWe may change this Agreement from time to time by notifying you of such changes by any reasonable means, including by posting a revised Agreement through the Service. Any such changes will not apply to any dispute between you and us arising prior to the date on which we posted the revised Agreement incorporating such changes, or otherwise notified you of such changes.<br />\r\nYour use of the Service following any changes to this Agreement will constitute your acceptance of such changes. The &ldquo;Last Updated&rdquo; legend above indicates when this Agreement was last changed. We may, at any time and without liability, modify or discontinue all or part of the Service; charge, modify or waive any fees required to use the Service; or offer opportunities to some or all Service users.</p>\r\n\r\n<p><br />\r\n<strong>24. Miscellaneous.</strong><br />\r\nThis Agreement does not, and shall not be construed to, create any partnership, joint venture, employer-employee, agency or franchisor-franchisee relationship between you and Company. If any provision of this Agreement is found to be unlawful, void or for any reason unenforceable, that provision will be deemed severable from this Agreement and will not affect the validity and enforceability of any remaining provision. You may not assign, transfer or sublicense any or all your rights or obligations under this Agreement without our express prior written consent. We may assign, transfer or sublicense any or all our rights or obligations under this Agreement without restriction. No waiver by either party of any breach or default under this Agreement will be deemed to be a waiver of any preceding or subsequent breach or default. Any heading, caption or section title contained herein is for convenience only, and in no way defines or explains any section or provision. All terms defined in the singular shall have the same meanings when used in the plural, where appropriate and unless otherwise specified. Any use of the term &ldquo;including&rdquo; or variations thereof in this Agreement shall be construed as if followed by the phrase &ldquo;without limitation.&rdquo; This Agreement, including any terms and conditions incorporated herein, is the entire agreement between you and Company relating to the subject matter hereof, and supersedes any and all prior or contemporaneous written or oral agreements or understandings between you and Company relating to such subject matter. Notices to you (including notices of changes to this Agreement) may be made via posting to the Service or by e-mail (including in each case via links), or by regular mail. Without limitation, a printed version of this Agreement and of any notice given in electronic form shall be admissible in judicial or administrative proceedings based upon or relating to this Agreement to the same extent and subject to the same conditions as other business documents and records originally generated and maintained in printed form. The company will not be responsible for any failure to fulfill any obligation due to any cause beyond its control.</p>\r\n\r\n<p><strong>25. Apple-Specific Terms.</strong><br />\r\nIn addition to your agreement with the foregoing terms and conditions, and notwithstanding anything to the contrary herein, the following provisions apply with respect to your use of any version of the App compatible with the iOS operating system of Apple Inc. (&ldquo;Apple&rdquo;). Apple is not a party to this Agreement and does not own and is not responsible for the App. Apple is not providing any warranty for the App except, if applicable, to refund the purchase price for it. Apple is not responsible for maintenance or other support services for the App and shall not be responsible for any other claims, losses, liabilities, damages, costs or expenses with respect to the App, including any third-party product liability claims, claims that the App fails to conform to any applicable legal or regulatory requirement, claims arising under consumer protection or similar legislation, and claims with respect to intellectual property infringement. Any inquiries or complaints relating to the use of the App, including those pertaining to intellectual property rights, must be directed to Company in accordance with the &ldquo;Information or Complaints&rdquo; section above. The license you have been granted herein is limited to a non-transferable license to use the App on an Apple-branded product that runs Apple&rsquo;s iOS operating system and is owned or controlled by you, or as otherwise permitted by the Usage Rules set forth in Apple&rsquo;s App Store Terms of Service. In addition, you must comply with the terms of any third-party agreement applicable to you when using the App, such as your wireless data service agreement. Apple and Apple&rsquo;s subsidiaries are third-party beneficiaries of this Agreement and, upon your acceptance of the terms and conditions of this Agreement, will have the right (and will be deemed to have accepted the right) to enforce this Agreement against you as a third-party beneficiary thereof; notwithstanding the foregoing, Company&rsquo;s right to enter into, rescind or terminate any variation, waiver or settlement under this Agreement is not subject to the consent of any third party.<br />\r\n&nbsp;</p>\r\n', ' ', '', '', 1, 1601059446);
INSERT INTO `cms` (`id`, `name`, `type`, `body`, `sub_description`, `attached`, `link`, `status`, `modified_date`) VALUES
(6, 'Privacy Policy', 'privacy_policy', '<p>April 2nd ,2020<br />\r\nWe respect your privacy and are committed to protecting your personal information. This privacy policy describes how we collect, use and share your personal information and your choices regarding this information. Please read this privacy policy carefully before using our Services.<br />\r\nIn this privacy policy:<br />\r\n<strong>Services&nbsp;</strong>means the officeyew mobile application, the website at&nbsp;<a href=\"http://www.officeyew.com\">www.officeyew.com</a>&nbsp;and any other products, services, content, features, technologies, or functions, and all related websites, applications and services offered to you by us.<br />\r\n<strong>Platform&nbsp;</strong>means the websites, mobile apps, mobile sites or other online properties through which we offer our Services.<br />\r\nCONTENTS<br />\r\n1. Who we are<br />\r\n2. The personal information we collect about you and where it comes from<br />\r\n3. The purposes for collecting your personal information<br />\r\n4. Sharing your personal information<br />\r\n5. Communication and marketing<br />\r\n6. Your rights<br />\r\n7. How long we store your data<br />\r\n8. Technical and organizational measures and processing security<br />\r\n9. Links to third-party websites<br />\r\n10. User-submitted content<br />\r\n11. State privacy rights<br />\r\n12. Changes to the privacy policy<br />\r\n13. Contact details</p>\r\n\r\n<p><br />\r\n&nbsp;<strong>1. Who we are</strong><br />\r\nOfficeyew is incorporated in The united States as Officeyew LLC., and our registered address is: Dean de Gouveia, 1 Serena Court, Newport Beach, CA &nbsp;(&ldquo;officeyew&rdquo;, &ldquo;we&rdquo; or &ldquo;us&rdquo;). We are the data controller and responsible for your personal information collected through our Services.<br />\r\n<strong>2. The personal information we collect about you and where it comes from</strong><br />\r\nWe collect information, including personal information, to provide the Services and operate our Platform. We also use the information we collect to improve our Services. The information we collect and how we collect it is set out below.<br />\r\n<strong>2.1 Information you provide to us through direct interactions with our Platform</strong><br />\r\nDepending on the choices you make when registering for, or during the process of using our Services, you may be asked for and opt to provide the following personal information:</p>\r\n\r\n<ul>\r\n	<li>e-mail address;</li>\r\n	<li>mobile telephone number;</li>\r\n	<li>geographic location;</li>\r\n	<li>profile picture;</li>\r\n	<li>user ID;</li>\r\n	<li>Facebook or Google account details;</li>\r\n	<li>driver&rsquo;s license or other government ID; and</li>\r\n	<li>any other information you choose to provide in connection with your account.</li>\r\n</ul>\r\n\r\n<p>Please note that your username and your profile picture will be made available to other users and the public when you use some of our Services. For example, when you post a product some of your information will be available to Platform users, so you should exercise discretion when using the Services to post personal information.<br />\r\nWhile we protect the information, you share with officeyew, we are not responsible for protecting such information that you choose to share with third parties through our Services and Platform (e.g., sending your telephone number to another user through the Services).<br />\r\n<strong>2.2 Information we collect from you automatically when you use our Services</strong><br />\r\nWhen you interact with our Platform or use our Services, we automatically collect the following information about you:</p>\r\n\r\n<ul>\r\n	<li><strong>Device Information.</strong>&nbsp;We collect device-specific information such as operating system version, your device makes and model and name of the mobile network that you are using. We assign an internal identifier to your device and associate all of this information with your officeyew account.</li>\r\n	<li><strong>Location information.</strong>&nbsp;Depending on your device permissions, if you post an item on our Platform, we automatically collect and process information about your actual location. We use various technologies to determine location, including IP address, GPS, Wi-Fi access points and mobile towers. Your location data allows you to see user items near you and helps you in posting items within your location.</li>\r\n	<li><strong>Client and Log data.</strong>&nbsp;Technical details, including the Internet Protocol (IP) address of your device, time zone and operating system. We will also store your login information (registration date, date of last password change, date of last successful login), type and version of your browser.</li>\r\n	<li><strong>Usage Information.</strong>&nbsp;We collect information about your activity on our Platform which includes a date and time stamp of each visit, advertisement banners or content that you clicked, your interaction with such advertisements, clickstream information, duration of your visit and the order in which you visit the content on our Platform.</li>\r\n	<li><strong>Cookies.</strong>&nbsp;If you access the Services through a web browser, we use cookies to manage our users&rsquo; sessions, to store your preferences and language selection and to deliver you relevant advertisements.&nbsp;&#39;Cookies&#39;&nbsp;are small text files transferred by a web server to the hard drive of your device. Cookies may be used to collect the date and time of your visit, your browsing history, your preferences, and your username. You can set your browser to refuse all or some cookies, or to alert you when websites set or access cookies. If you disable or refuse cookies, please note that some parts of our Services/Platform may become inaccessible or not function properly.&nbsp; Most web browsers are set to accept cookies by default. You can usually choose to set your browser to remove or reject browser cookies. Please note that if you choose to remove or reject cookies, this could affect the availability and functionality of our Platforms. Please note that not all tracking will stop even if you delete cookies.</li>\r\n	<li><strong>Analytics.</strong>&nbsp;We use Google Analytics, which uses cookies and similar technologies to collect and analyze information about use of the Services and report on activities and trends. This service may also collect information regarding the use of other websites, apps and online resources. You can learn about Google&rsquo;s practices by going to&nbsp;their website. You can opt out of certain Google Analytics data collection practices by downloading the Google Analytics Browser Disabling Add-on, available&nbsp;here.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2.3 Information from third party sources</strong></p>\r\n\r\n<p>We may also collect personal information from third parties. For example, we use third party machine learning software to analyze all communications through our chat feature for fraud prevention and to promote safety by blocking spam or abusive messages that may have been sent to you by any other user. This software compares attributes of the message, user or profile against its proprietary database to assess the probability that a message is spam or abusive.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>2.4 Information we collect from Postings and Chat Messages</strong><br />\r\nAnything you write in a chat message to another user is stored in our systems as a chat message. This may include your name, your address, the name of a meetup location and any other information you choose to voluntarily share with another user or with the officeyew community.<br />\r\nWe do not mine user chat messages for information or pull any such information (such as if you provide another user your address) and store it separately. For example, if you chat with another user about your age or education history, we do not store this data or use it for any purpose, except that we store your chat history as described in this Policy.</p>\r\n\r\n<p><br />\r\n<strong>3. The purposes for collecting your personal information</strong><br />\r\nWe will only use your personal information as set out in this privacy policy. We have set out below a description of the ways we use your personal information. We will not collect additional categories of personal information or use the personal information we collect for materially different, unrelated, or incompatible purposes without providing you notice.<br />\r\n<strong>3.1 Providing access and delivering Services through our Platform</strong><br />\r\nWe use the information you provide to provide the Services. For example:</p>\r\n\r\n<ul>\r\n	<li>If you log in using your email id, we use your user ID or your e-mail address to identify you as a user and provide access to our Platform (such as your settings and your history, etc.).</li>\r\n	<li>If you log in using your Google or Facebook account, we use your first name and last name from your Google or Facebook profile and the e-mail address to identify you as a user on our Platform and to provide you access to our Platform.</li>\r\n	<li>We use your e-mail address to make suggestions and recommendations to you about our Services that may be of interest to you.</li>\r\n</ul>\r\n\r\n<p><strong>3.2. Improving your experience on the Platform</strong><br />\r\nWe use the information you provide to improve your experience on the Platform. For example:<br />\r\nWe use clickstream data to:<br />\r\noffer you tailored content, such as giving you more relevant search results when using our Services.<br />\r\nto determine how much time you spend on our Platform and in what manner you navigate through our Platform in order to understand your interests and to improve our Services based on this data. For example, we may provide you with suggestions on content that you can visit based on the contents you have clicked.<br />\r\nto monitor and report the effectiveness of the campaign delivery to our business partners and for internal business analysis.<br />\r\nto prevent repeatedly displaying the same items to the same user.<br />\r\nWe use your location data for the following purposes:<br />\r\nto compile anonymous and aggregated information about the characteristics and behavior of officeyew users, including for the purposes of business analysis, segmentation and development of anonymous profiles.<br />\r\nto enhance the performance of our Services and to personalize the content we direct towards you. For example, with the help of location data we display ad listings that are in your vicinity to improve your buying experience.<br />\r\nto measure and monitor your interaction with the third-party advertisements banners we place on our Platform.</p>\r\n\r\n<p><br />\r\n<strong>3.3 Providing you a safe and secure Platform</strong><br />\r\nWe use the information you provide to provide you a safe and secure Platform. For example<br />\r\nWe use your email address and unique device identifiers to administer and protect our Platform (including troubleshooting, data analysis, testing, fraud prevention, system maintenance, support, reporting and hosting of data).<br />\r\nWe use third party machine learning software to analyze all communications through our chat feature for fraud prevention and to promote safety by blocking spam or abusive messages that may have been sent to you by any other user.<br />\r\nIf you provide us with your telephone number, we may use that information to SMS verify your telephone number and increase the trust and safety of our Platform.<br />\r\nIn addition, we may aggregate and/or de-identify data about visitors to our Platforms and use it for any purpose, including product and service development and improvement activities.</p>\r\n\r\n<p><br />\r\n<strong>4. Sharing your personal information</strong><br />\r\nWe may share your personal information with the parties set out below for the purposes set out above.<br />\r\n<strong>Corporate affiliates:</strong>&nbsp;We may share your data with other officeyew corporate affiliates (companies in the same ownership group) which are located within as well as outside the U.S.A. We have employees based in different countries around the world that perform different functions for the Company. Employees around the Company frequently analyze data for different purposes and to improve the Services.<br />\r\n<strong>Third Party Vendors and Service Providers:&nbsp;</strong>We share your data with third party vendors and other service providers that help us deliver certain aspects of our Services. For example, we use cloud storage facilities to store our data, we use customer support software providers to administer and respond to user inquiries and we use third party software to monitor for fraud within the Platform. We need to share your data with these third parties otherwise we would not be able to provide the Service.<br />\r\n<strong>Advertisers:</strong>&nbsp;We partner with demand-side platforms who buy our ad placements through auctions such as Criteo, DoubleClick, etc. We share your information with them in a de-identified and aggregated form for monitoring and reporting the effectiveness of the campaign delivery to our business partners and for internal business analysis.<br />\r\n<strong>Analytics Providers:</strong>&nbsp;In order to improve our Services, we will sometimes share your non-identifiable information with analytics providers that help us analyze how people are using our Services. For example, we use common industry-wide analytics software to understand how people use our app so we can improve the Services and increase engagement.<br />\r\n<strong>Law enforcement authorities, regulators, grand juries, courts and tribunals, governmental or public bodies and others:&nbsp;</strong>We may disclose your data, including your personal information, to law enforcement authorities, regulators, grand juries, courts and tribunals, governmental or public bodies and other relevant third parties as we believe necessary or appropriate to protect people or property, to protect our services, rights or property, to comply with legal or regulatory requirements and to respond to legal process, law enforcement requests and requests from other public and government authorities.<br />\r\n<strong>Business Transfer or Reorganization:</strong>&nbsp;We reserve the right to transfer the information we maintain in the event we sell or transfer all or a portion of our business or assets. If we engage in such a sale or transfer, we will make reasonable efforts to direct the recipient to use your personal information in a manner that is consistent with this privacy policy. After such a sale or transfer, you may contact the recipient with any inquiries concerning the recipient&rsquo;s privacy practices.<br />\r\n<strong>Publicly available information:</strong>&nbsp;When you use certain aspects of our Services, the information is visible to other officeyew users (all officeyew users, in the case of a posted item, and the user you are chatting within the case of a chat message). This includes any information you post or chat, such as your name, your email address, your location and your contact number. Please note, any information you provide to other users can always be shared by them with others so please exercise discretion in this respect.</p>\r\n\r\n<p><br />\r\n<strong>5. Communication and marketing</strong><br />\r\nWe may communicate with you by email or in-app notification in connection with our Services/Platform to confirm your registration, to inform you in case your product listing has become live/expired and for other transactional messages in relation to our Services.<br />\r\nWe (or our service providers and advertising partners) may send you direct marketing communications and information about our Services that we consider may be of interest to you. We will provide an option to unsubscribe or opt out of further communication on any electronic marketing communication sent to you or you may opt out by contacting us as set out in the &ldquo;contact details&rdquo; section below.<br />\r\nIf you opt out of receiving marketing or commercial communications, we retain the right to send you non-marketing communications such as correspondence about your relationship with us, information about transactions, or notifying you of updates to our Privacy Notices or Terms of Use. Please note that we also carry out digital advertising campaigns from time to time that do not rely on your personal information.</p>\r\n\r\n<p><br />\r\n<strong>6. Your rights</strong><br />\r\nThis section describes your rights and explains how to exercise those rights.<br />\r\nYou may have rights under local data protection laws in relation to your personal information. For example, the California Consumer Privacy Act (&ldquo;CCPA&rdquo;) provides consumers (California residents) with specific rights regarding their personal information. As a part of our commitment to our users, we are extending the following rights, including certain CCPA rights, as described below, to all our users.<br />\r\nThese rights are not absolute and are subject to certain exceptions. For instance, we cannot disclose or permit access to specific pieces of personal information if the disclosure or access would present a certain level of risk to the security of the personal information, your account with us or the security of the business&rsquo;s systems of networks.</p>\r\n\r\n<p><br />\r\n<strong>6.1 Access to Specific Information and Data Portability Rights</strong><br />\r\nYou have the right to request that officeyew disclose certain information to you about our collection and usage of your personal information over the last 12 months. You can receive a copy of the personal information we hold about you by logging into your account settings on&nbsp;www.officeyew.com&nbsp;and requesting such information.<br />\r\nOnce we receive and confirm your verifiable consumer request (see&nbsp;Page TBD&nbsp;below), we will disclose to you:<br />\r\nThe categories of personal information we collected about you.<br />\r\nThe sources for the personal information we collected about you.<br />\r\nOur business or commercial purpose for collecting or selling that personal information.<br />\r\nThe categories of third parties with whom we share the personal information.<br />\r\nThe specific pieces of personal information we collected about you (also called a data portability request).<br />\r\nIf we sold or disclosed your personal information for a business purpose, identifying the personal information categories that each category recipient received.</p>\r\n\r\n<p><br />\r\n<strong>6.2 Deletion Request Rights</strong><br />\r\nYou have the right to request that we delete personal information that we have collected from you, subject to certain exceptions. You can request to delete your personal information by logging into your account settings on&nbsp;www.officeyew.com&nbsp;and submitting a delete request.<br />\r\nOnce we receive and confirm your verifiable consumer request (see page TBD&nbsp;below), we will delete your personal information from our records. Under certain circumstances, as allowed by law, we may delay or deny your request. Officeyew reserves the right to retain portions of your personal information for a limited time, as permitted by law. For example, for Trust and Safety purposes or to respond to a law enforcement request.</p>\r\n\r\n<p><br />\r\n<strong>6.3 Exercising Access and Deletion Rights</strong><br />\r\nIn addition to the methods described above for exercising your delete and access rights, you may also submit a verifiable consumer request to us by sending an email inquiry to&nbsp;&nbsp;mydata@officeyew.com.<br />\r\nWe cannot respond to your request or provide you with personal information if we cannot verify your identity or authority to make the request and confirm the personal information relates to you. We reserve the right to verify your identity in connection with any requests regarding personal information to help ensure that we provide the information we maintain to the individual to whom it pertains, and allow only that individual or their authorized representatives to exercise rights with respect to that information.<br />\r\nMaking a verifiable consumer request does not require you to create an account with us. However, we do consider requests made through your password-protected account sufficiently verified when the request relates to personal information associated with that specific account.<br />\r\nWe will only use personal information provided in a verifiable consumer request to verify the requestor&#39;s identity or authority to make the request. If you designate an authorized agent to make a request on your behalf, you may have to submit information confirming such designation.<br />\r\nFor instructions on exercising sale opt-out rights, see&nbsp;(Page TBD)&nbsp;below.</p>\r\n\r\n<p><br />\r\n<strong>6.4 Response Timing and Format</strong><br />\r\nWe endeavor to respond promptly to verifiable consumer requests, and in any case no longer than forty-five (45) days from the date of such request. If we require more time, we will inform you of the reason and extension period in writing.<br />\r\nAny disclosures we provide will only cover the 12-month period preceding the verifiable consumer request&#39;s receipt. The response we provide will also explain, if applicable, any reasons we are not able to comply with all or any portion of such request. For personal information access requests, we endeavor to provide the information in a portable format that is readily useable and should allow you to transmit the information from one entity to another entity without hindrance, specifically in &ldquo;.csv&rdquo; files.<br />\r\nWe do not charge a fee to process or respond to your verifiable consumer request unless it is excessive, repetitive, or manifestly unfounded. If we determine that the request warrants a fee, we will tell you why we made that decision and provide you with a cost estimate before completing your request.</p>\r\n\r\n<p><br />\r\n<strong>6.5 Right to request correction</strong><br />\r\nYou have the right to request the correction of any of the personal information we have about you, although we may need to verify the accuracy of the new data you provide to us. In order to request the correction of your personal information, please email&nbsp;mydata@officeyew.com.</p>\r\n\r\n<p><br />\r\n<strong>6.6 Personal Information Sales Opt-Out Rights</strong><br />\r\nThe CCPA defines the terms &ldquo;sale&rdquo; much more broadly than the common interpretation of the term. For example, sharing user IP addresses with advertising platforms in order to show relevant advertising, is now considered a &ldquo;sale&rdquo; under CCPA. As part of our commitment to our users, we are extending the CCPA&rsquo;s Do Not Sell My Personal Information rights to all of our users.<br />\r\nIn order to exercise your right to opt out of the &ldquo;sale&rdquo; of your personal information as defined by the CCPA, please click the&nbsp;&ldquo;Page TBD&rdquo;&nbsp;or email&nbsp;mydata@officeyew.com.<br />\r\nYou do not need to create an account with us to exercise your opt-out rights. We will only use personal information provided in an opt-out request to review and comply with the request.</p>\r\n\r\n<p><br />\r\n<strong>7. How long do we store your data?</strong><br />\r\nWe will only retain your personal information for as long as necessary to fulfill the purposes we collected it for, including for the purposes of satisfying any legal, accounting, or reporting requirements. Please note that we often need to retain certain data for recordkeeping purposes and/or to complete any transactions that you began prior to requesting a change or deletion.</p>\r\n\r\n<p><br />\r\n<strong>8. Technical and organizational measures and processing security</strong><br />\r\nWe maintain administrative, technical and physical safeguards designed to protect personal information against accidental, unlawful or unauthorized destruction, loss, alteration, access, disclosure or use. For example, all information you provide to us is stored on our secure servers behind firewalls.<br />\r\nThe safety and security of your information also depends on you. Where you have a password to access to certain parts of our Services, you are responsible for keeping this password confidential. We ask you not to share your password with anyone.<br />\r\nPlease note, despite the measures we have implemented to protect your data, the transfer of data through the Internet or other open networks is never completely secure and there is a risk that your personal information may be accessed by unauthorized third parties.</p>\r\n\r\n<p><br />\r\n<strong>9. Links to third-party websites</strong><br />\r\nOur Platform may contain links to third party websites or apps. If you click on one of these links, please note that each one will have its own privacy policy. We do not control these websites/apps and are not responsible for those policies. When you leave our Platform, we encourage you to read the privacy policy of every website you visit.</p>\r\n\r\n<p><br />\r\n<strong>10. User-Submitted content</strong><br />\r\nSome features of the Services allow you to post content on our Platform or social media pages, such as photos. We do not have control over how other users who have access to the Platform will use any content you post publicly or send to them privately. We urge you to exercise discretion when sharing personal information with other users.<br />\r\nWe may also use any ad you post on officeyew, including the uploaded photo or image of the product as well as other data (including user name and location) associated with the ad, for our own advertising purposes, including social media, Facebook ads, newsletters and ads for any media.<br />\r\nTo help protect your privacy, we allow only limited access to other users&rsquo; contact information as necessary to fulfill your transactions and collect payments. However, when users are involved in a transaction, they may have access to each other&rsquo;s name, user ID, email address, and other contact information.</p>\r\n\r\n<p><br />\r\n<strong>11. State Privacy Rights</strong><br />\r\nCALIFORNIA<br />\r\nShine the Light Law:&nbsp;California law permits residents of California to request notice of how their information is shared with third parties for direct marketing purposes or to opt out of such sharing. If you are a California resident and would like a copy of this notice or to opt out, please submit a written request to&nbsp;privacy@officeyew.com&nbsp;or 1 Serena Court, Newport Beach, CA 92663.<br />\r\nCalifornia Consumer Privacy Act of 2018:&nbsp;The CCPA gives California consumers the rights to learn about and control certain aspects of how a business handles the personal information that a business collects about them.</p>\r\n\r\n<p><br />\r\n<strong>11.1 Information we collect</strong><br />\r\nThe CCPA requires that we disclose certain categories of personal information that we collect, the sources of that personal information, the purpose of collecting such information and the categories of third parties with whom we share that information. The chart below summarizes the CCPA disclosure requirements and where you can find this information in this privacy policy<br />\r\nPersonal Information Category&nbsp;&nbsp; &nbsp;Sources of Personal Information&nbsp;(Section 3)&nbsp;&nbsp; &nbsp;Purpose of Collecting Information&nbsp;(Section 4)&nbsp;&nbsp; &nbsp;Categories of third parties we share information with&nbsp;(Section 5)<br />\r\nA) Identifiers reasonably capable of being associated with a person or household (such as online identifier, email address)&nbsp;&nbsp; &nbsp;Information you Provide Us; Information we collect from you automatically when you use our Service&nbsp;&nbsp; &nbsp;Providing access to and delivering the Service; Improving your experience on the Platform; Providing you a safe and secure platform&nbsp;&nbsp; &nbsp;Corporate Affiliates, Third Party Vendors and Service Providers; Advertisers; Analytics Providers; Law Enforcement Authorities<br />\r\nB) Personal information categories listed in the California Customer records statute (Cal. Civ. Code Section 1798.80(e)) such as name and telephone number&nbsp;&nbsp; &nbsp;Information you Provide Us&nbsp;&nbsp; &nbsp;Providing access to and delivering the Service; Improving your officeyew experience on the Platform; Providing you a safe and secure platform&nbsp;&nbsp; &nbsp;Corporate Affiliates; Third Party Vendors and Service Providers; Law Enforcement Authorities<br />\r\nC) Protected classifications under CA and federal law, including gender, age and citizenship&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Applicable<br />\r\nD) Commercial Information, including products or services purchased, obtained or considered, or purchasing or consuming histories or tendencies&nbsp;&nbsp; &nbsp;Information we collect from you automatically when you use our Service&nbsp;&nbsp; &nbsp;Providing access to and delivering the Service; Improving your experience on the Platform; Providing you a safe and secure platform&nbsp;&nbsp; &nbsp;Corporate Affiliates; Third Party Vendors and Service Providers; Analytics Providers; Law Enforcement Authorities<br />\r\nE) Biometric Information&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Applicable<br />\r\nF) Internet or network activity and usage information&nbsp;&nbsp; &nbsp;Information we collect from you automatically when you use our Service&nbsp;&nbsp; &nbsp;Providing access to and delivering the Service; Improving your experience on the Platform&nbsp;&nbsp; &nbsp;Corporate Affiliates; Third Party Vendors and Service Providers; Analytics Providers; Law Enforcement Authorities<br />\r\nG) Geolocation Data&nbsp;&nbsp; &nbsp;Information we collect from you automatically when you use our Service&nbsp;&nbsp; &nbsp;Providing access to and delivering the Service; Improving your experience on the Platform&nbsp;&nbsp; &nbsp;Corporate Affiliates, Third Party Vendors and Service Providers, Advertisers; Analytics Providers; Law Enforcement Authorities<br />\r\nH) Audio, electronic, visual, thermal, olfactory, or similar information&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Applicable<br />\r\nI) Professional or employment-related information&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Applicable<br />\r\nJ) Education Information&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Collected&nbsp;&nbsp; &nbsp;Not Applicable<br />\r\nK) Inferences about preferences, characteristics, trends, predispositions&nbsp;&nbsp; &nbsp;Information you provide us; Information we collect from you automatically when you use our Service&nbsp;&nbsp; &nbsp;Providing access to and delivering the Service; Improving your experience on the Platform&nbsp;&nbsp; &nbsp;Corporate Affiliates; Third Party Vendors and Service Providers; Advertisers; Analytics Providers; Law Enforcement Authorities<br />\r\nNOTE: Any content contained in a chat message between users is stored as a chat message and not in your user profile or as a separate category of data. This may include certain categories of information listed above as &ldquo;Not Collected.&rdquo; For example, if you chat with another user about your age or education history, we do not store this data separately or use it for any purpose. We do not mine user chat messages for information and we do not share the content of our chat messages with any third parties and we do not use it for any purpose other than facilitating a chat service between users. Therefore, we have listed certain categories of data as Not Collected since they are not intentionally collected by us or used for a business purpose.</p>\r\n\r\n<p><br />\r\n<strong>11.2 Disclosure of personal information for a business purpose</strong><br />\r\nIn the preceding twelve (12) months, officeyew has disclosed the following categories of personal information for a business purpose:<br />\r\nIdentifiers reasonably capable of being associated with a person or household (such as name, online identifier, email address)<br />\r\nPersonal Information categories listed in California Customer records statute<br />\r\nCommercial Information, including products or services purchased, obtained or considered, or purchasing or consuming histories or tendencies<br />\r\nInternet or network activity and usage information<br />\r\nGeolocation Data<br />\r\nInferences about preferences, characteristics, trends, predispositions<br />\r\nWe have disclosed your personal information to the following categories of third parties:<br />\r\nCorporate Affiliates<br />\r\nThird Party Vendors and Service Providers<br />\r\nAdvertisers (for the purposes of showing you advertisements on officeyew)<br />\r\nAnalytics Providers (for obtaining analytics about the activity on our Platform)</p>\r\n\r\n<p><br />\r\n<strong>11.3 Sales of personal information</strong><br />\r\nWe respect your privacy and have never sold our users&rsquo; personal information as most people understand that term. Recent laws, such as the CCPA, provide California state residents various rights over their personal information and define terms like &ldquo;sale&rdquo; much more broadly than the common interpretation of the term. For example, sharing user IP addresses with advertising platforms in order to show relevant advertising, is now considered a &ldquo;sale&rdquo; under CCPA.<br />\r\nIn the preceding twelve (12) months, as defined by the CCPA, officeyew has &ldquo;sold&rdquo; (as defined in the CCPA) the following categories of personal information for a business purpose:<br />\r\nIdentifiers reasonably capable of being associated with a person or household (such as online identifier, email address)<br />\r\nCommercial Information, including products or services purchased, obtained or considered, or purchasing or consuming histories or tendencies<br />\r\nInternet or network activity and usage information<br />\r\nGeolocation Data<br />\r\nInferences about preferences, characteristics, trends, predispositions<br />\r\nAs defined by the CCPA, we &ldquo;sell&rdquo; your personal information to the following categories of third parties:<br />\r\nAdvertisers (for the purposes of showing you advertisements on officeyew); and<br />\r\nAnalytics Providers (for the purposes of obtaining analytics about the activity on our Platform).</p>\r\n\r\n<p><br />\r\n<strong>11.4. CA Rights</strong><br />\r\nUnder the CCPA, California residents have consumer rights including the right to access specific information and data portability; the right to request deletion of personal information; and the right to opt out of the &ldquo;sale&rdquo; of personal information (collectively &ldquo;Rights&rdquo;). We are extending these Rights to all of our users in the United States and they are described above in more detail in&nbsp;(TBD). In sum, the Rights and the methods for submitting requests are as follows:<br />\r\nConsumer Right&nbsp;&nbsp; &nbsp;Methods for Submitting Requests<br />\r\nRight of access to specific information and data portability rights&nbsp;&nbsp; &nbsp;User Settings at&nbsp;officeyew.com<br />\r\nmydata@officeyew.com<br />\r\nRight to request deletion of personal information&nbsp;&nbsp; &nbsp;User Settings at&nbsp;officeyew.com<br />\r\nmydata@officeyew.com<br />\r\nRight to opt out of a &ldquo;sale&rdquo; of personal information, as &ldquo;sale&rdquo; is defined under the CCPA&nbsp;&nbsp; &nbsp;Link TBD<br />\r\nmydata@officeyew.com<br />\r\nCalifornia residents also have a right not to be discriminated against for the exercise of their Rights.<br />\r\nNEVADA<br />\r\nNevada law permits residents of Nevada to opt-out of data sales by web operators. A &ldquo;sale&rdquo; under Nevada law means the exchange of personal identifiable information for monetary consideration to a person for that person to license or sell that personal identifiable information to additional persons. Officeyew does not sell your personal information under Nevada law. However, Officeyew is offering all its users the right to opt out of the sale of personal information under the CCPA, which we believe contains a broader definition of &ldquo;sale.&rdquo; If you are a Nevada resident and would like to opt-out of a &ldquo;sale&rdquo; of your personal information in accordance with the CCPA please.</p>\r\n\r\n<p><br />\r\n<strong>12. Changes to the privacy policy</strong><br />\r\nWe may amend this privacy policy from time to time. We will post changes on this page and will let you know through e-mail or other reasonable means. If you do not agree with the changes, you may close your account by you may close your account by going to your settings or contacting&nbsp;info@officeyew.com.</p>\r\n\r\n<p><br />\r\n<strong>13. Contact details</strong><br />\r\nIf you have any questions or comments regarding this policy, or wish to contact our Data Protection Officer, please contact us by email at&nbsp;privacy@officeyew.com&nbsp;or by mail at 1 Serena Court , Newport Beach, CA 92663. Please do not send sensitive information to us by email, as email communications are not always secure.</p>\r\n', ' ', '', '', 1, 1601058485),
(7, 'Trust and Safety', 'trust_safety', '<h2>What is Lorem Ipsum?</h2>\r\n\r\n<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', '', '', 1, 1599816282),
(8, 'Support', 'support', '<h2>Support for Officeyew</h2>\r\n\r\n<p>Shipping</p>\r\n\r\n<p>All shipping on Officeyew is Coordinated between the Buyer and the Seller. Shipping can be coordinated through the use of an Installer found on the Officeyew site.</p>\r\n\r\n<p>Buying</p>\r\n\r\n<p>Selling</p>\r\n\r\n<p>Installers</p>\r\n\r\n<p>Designers</p>\r\n\r\n<p>Candidates</p>\r\n\r\n<p>Job Postings</p>\r\n\r\n<p>Accounts</p>\r\n\r\n<p>Payments</p>\r\n', 'TBD', '', '', 1, 1611615665);
INSERT INTO `cms` (`id`, `name`, `type`, `body`, `sub_description`, `attached`, `link`, `status`, `modified_date`) VALUES
(9, 'Help', 'help', '<h1><strong>Officeyew Guidelines</strong></h1>\r\n\r\n<p><br />\r\nNot sure if you can sell your home office chair or two floors of your office&rsquo;s old workstations? The following are some guidelines you should be following when using officeyew. It is by no means exhaustive! We will take appropriate actions with respect to items or users we feel are abusing or not conducive to our community. However, these guidelines should give you a general sense of how to behave on officeyew. If you see anyone violating these guidelines, please report them to us using the Report a User or Report a Product feature.</p>\r\n\r\n<p>Thanks for being a part of our community!</p>\r\n\r\n<p>Great deals require trust. Act with integrity.<br />\r\nofficeyew is more than an app, it&rsquo;s a friendly marketplace.<br />\r\nIf it&rsquo;s not yours to sell, it&rsquo;s not for us.<br />\r\nWe follow the law, and you should too.<br />\r\nUnderstand and respect our Prohibited Items guidelines:<br />\r\nAdult content<br />\r\nDrugs &amp; alcohol<br />\r\nAnimals<br />\r\nFood<br />\r\nServices<br />\r\nSpam<br />\r\nWeapons and Other Dangerous Items<br />\r\nMiscellaneous</p>\r\n\r\n<h2><br />\r\n<strong>Great deals require trust. Act with integrity.</strong></h2>\r\n\r\n<p><br />\r\nOfficeyew makes it easier than ever to find great deals in your area or outside your area, but we can&rsquo;t do it alone. Every deal requires trust. Accurately and fairly represent yourself and the items you&rsquo;re buying or selling on Officeyew. Attempts to deceive or defraud users are not tolerated.<br />\r\nProhibited conduct:<br />\r\nAttempts to lure users off officeyew to other services are prohibited<br />\r\nNegotiate prices in good faith, and don&rsquo;t list items at a price at which you don&rsquo;t intend to sell<br />\r\nYou may not circumvent our anti-spam and anti-fraud efforts (this includes multiple postings of the same item)<br />\r\nAll items for sale should include photos that are clear, well-lit, and accurately represent what you&rsquo;re selling</p>\r\n\r\n<h2><br />\r\n<strong>Officeyew is more than an app, it&rsquo;s a friendly marketplace.</strong></h2>\r\n\r\n<p><br />\r\nWe built a marketplace around assisting individuals or companies sell their office furniture items that you did not have the need for, but we think it&rsquo;s important to hang onto the values you learned as a kid. As the saying goes &ldquo;One man&rsquo;s trash is another man&rsquo;s treasure&rdquo; We&rsquo;re talking about the basics: treat others as you&rsquo;d like to be treated and do what you say you will. Remember, most of the people you talk to on officeyew are your neighbors or industry colleagues.<br />\r\n<strong>Prohibited conduct:</strong><br />\r\nMessages that are intended to harass, intimidate, threaten, or demean another user<br />\r\nItems that promote or support hate groups<br />\r\nItems that depict or glorify violence<br />\r\nRacial slurs</p>\r\n\r\n<h2><br />\r\n<strong>If it&rsquo;s not yours to sell, it&rsquo;s not for us.</strong></h2>\r\n\r\n<p><br />\r\nYou must rightfully own anything you intend to sell on officeyew. We have a zero-tolerance policy for stolen goods. Remember, violating someone else&rsquo;s intellectual property is a form of theft. This means counterfeit goods or replicas that are being sold without permission from the rightful owner aren&rsquo;t allowed.<br />\r\n<strong>Prohibited items include:</strong><br />\r\nCounterfeit goods<br />\r\nReplicas that are sold without consent from the trademark owner<br />\r\nStocks and other securities, as well as other non-transferable items<br />\r\nStolen goods<br />\r\nHacking tools<br />\r\nVehicles where you are not the titleholder</p>\r\n\r\n<h2><strong>We follow the law, and you should too.</strong></h2>\r\n\r\n<p><br />\r\nIt&rsquo;s your responsibility to understand all laws where you live and to make sure your activity on officeyew is legal. For example, you may need to make sure it&rsquo;s legal for you to buy or sell your item, or that you are following the law regarding furniture you have listed and are looking to sell.</p>\r\n\r\n<p><strong>Prohibited conduct:</strong></p>\r\n\r\n<p>Postings or messages that are defamatory, libelous, fraudulent or otherwise violate the law.<br />\r\nPostings or messages that violate right of publicity or privacy.<br />\r\nPosting or transmitting any virus, worm, Trojan horse, Easter egg, time bomb, spyware or other computer code, file or program that&rsquo;s or is potentially harmful or invasive or intended to damage or hijack the operation of, or to monitor the use of, any hardware, software or equipment (each, a &ldquo;Virus&rdquo;).<br />\r\nUsing office for any purpose that&rsquo;s fraudulent or unlawful.<br />\r\nHarvesting or collecting information about our users or directing our users to external websites or apps to harvest or collect their information.<br />\r\nInterfering with or disrupting the operation of officeyew or our servers or networks.<br />\r\nRestricting or inhibiting any other person from using officeyew.<br />\r\nReproducing, modifying, distributing or otherwise exploiting any portion of officeyew except as authorized by us.<br />\r\nReverse engineering, decompiling or disassembling any portion of officeyew.<br />\r\nSystematically downloading our content.<br />\r\nUnless you&rsquo;re a public search engine, using any robot, spider, site search/retrieval application or other manual or automatic device to retrieve, index, &ldquo;scrape,&rdquo; &ldquo;data mine&rdquo; or otherwise gather our content.<br />\r\nAsking a prospective buyer or job candidate questions about their sex, race, religion, sexual orientation, gender, or family status.</p>\r\n\r\n<h2><br />\r\n<strong>Understand and respect our Prohibited Items guidelines:</strong></h2>\r\n\r\n<p><br />\r\nRead and respect our prohibited items guidelines, but most importantly, use common sense. If you wouldn&rsquo;t sell it to your family, it&rsquo;s not for officeyew.</p>\r\n\r\n<p>This list covers most of what isn&rsquo;t allowed, but we&rsquo;ll remove any item we feel is harmful to the officeyew marketplace.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Adult content</strong></h2>\r\n\r\n<p><br />\r\nLeave some things to the imagination. Sexual content, adult toys or other items that include explicit nudity are not allowed on officeyew</p>\r\n\r\n<p><strong>Prohibited items include:</strong></p>\r\n\r\n<p>Pornography<br />\r\nAdult Toys</p>\r\n\r\n<h2><br />\r\n<strong>Drugs &amp; alcohol</strong></h2>\r\n\r\n<p><br />\r\nWe know all the great deals you find on officeyew will make your head spin, but the products shouldn&rsquo;t to do the same. Officeyew isn&rsquo;t a place to sell drugs or alcohol, even if it&rsquo;s legal to do so in your jurisdiction. That said, you can buy and sell any item related to office furniture and its accessories.</p>\r\n\r\n<p><strong>Prohibited items include:</strong></p>\r\n\r\n<p>Alcoholic products<br />\r\nTobacco<br />\r\nE-cigarettes and e-juice<br />\r\nIllegal Drugs<br />\r\nPrescription drugs or medical devices<br />\r\nOver-the-counter drugs and supplements</p>\r\n\r\n<h2><br />\r\n<strong>Animals</strong></h2>\r\n\r\n<p><br />\r\nKeep the puppy photos for your other social media. We love animals, but you can&rsquo;t use our app to sell them.<br />\r\nProhibited listings include:<br />\r\nLive animals (including coral)<br />\r\nFossils<br />\r\nSkin and bones from endangered or protected species</p>\r\n\r\n<h2><br />\r\n<strong>Food</strong></h2>\r\n\r\n<p><br />\r\nIt doesn&rsquo;t matter how good your cooking is, food and other related food products are not allowed.</p>\r\n\r\n<p><strong>Prohibited items include:</strong></p>\r\n\r\n<p>Party trays of perishable food<br />\r\nHomemade jams and jellies<br />\r\nBaby food and formula</p>\r\n\r\n<h2><br />\r\n<strong>Services</strong></h2>\r\n\r\n<p><br />\r\nWhether you&rsquo;re an amazing installer or designer in your free time, or are known as that friend who can fix or design anything, you can turn your passion into a profession by offering your service to others on officeyew just as long as you are legitimate with a, license, registered company, insured and bonded. We currently don&rsquo;t allow some professional services like legal, financial, or most medical services. Additionally, you can&rsquo;t offer to do something illegal for someone else - like unlocking their phone. See below for a list of prohibited services.</p>\r\n\r\n<p><br />\r\n<strong>Prohibited services include:</strong><br />\r\nFinancial Services (tax filing and preparation, insurance, loans, and credit scoring)<br />\r\nLegal Services (debt collection, will preparation, legal advice)<br />\r\nMedical Services (chiropractic care, cosmetic services like Botox)<br />\r\nEscort Services, companionship, matchmaking<br />\r\nMassage services<br />\r\nServices which are themselves illegal (unlocking phones and other hardware) or may include illegal activity<br />\r\nServices related to alcohol or drugs<br />\r\nServices involving guns or other weapons<br />\r\nAffiliate or pyramid schemes<br />\r\nServices making extreme or unrealistic promises (&ldquo;Lose 50 lbs in a week!&rdquo;, &ldquo;Cure cancer!&rdquo;)</p>\r\n\r\n<h2><br />\r\n<strong>Spam</strong></h2>\r\n\r\n<p><br />\r\nWe don&rsquo;t allow spam on our app - not the meat product and not the annoying, untargeted behavior that clogs up the internet. Don&rsquo;t repeatedly post the same products, and don&rsquo;t start a conversation with someone unless you&#39;re actually interested in buying their item.<br />\r\n<strong>Prohibited items include:</strong><br />\r\nRepeated listings of the same item<br />\r\nMass messages sent without the intent of buying or selling items on officeyew</p>\r\n\r\n<h2><br />\r\n<strong>Weapons and Other Dangerous Items</strong></h2>\r\n\r\n<p><br />\r\nYour safety will always be officeyew&rsquo;s top priority. That&rsquo;s why we prohibit dangerous items like firearms, fireworks, or items that have been widely recalled.<br />\r\n<strong>Prohibited items include:</strong><br />\r\nAny Item not Office Furniture or its accessories related<br />\r\nAll firearms, accessories and ammunition<br />\r\nAirsoft, BB, or other novelty guns that do not clearly display an orange safety tip<br />\r\nTasers<br />\r\nBurglary Tools<br />\r\nFireworks<br />\r\nPesticides, tear gas, and other hazardous chemicals or controlled substances</p>\r\n\r\n<h2><br />\r\n<strong>Miscellaneous</strong></h2>\r\n\r\n<p><br />\r\nThe policies above cover most of what isn&rsquo;t allowed but are not exhaustive. We&rsquo;ll remove any item we feel is harmful or no affiliated with the officeyew marketplace.<br />\r\nOther prohibited items that are commonly posted are listed below.<br />\r\n<strong>Prohibited items include:</strong><br />\r\nUsed cosmetics<br />\r\nLottery tickets and other sweepstakes or gambling<br />\r\nItems obtained through government assistance<br />\r\nBodily fluids such as breast milk<br />\r\nSale of currency as a product (cryptocurrencies, euros, dollars, etc.). Collectibles are okay.<br />\r\nPlease visit the (Best practices Pages TBD)&nbsp;for more information on the best way to buy and sell on officeyew. For specific questions, please visit our&nbsp;FAQ.<br />\r\n&nbsp;</p>\r\n', ' ', '', '', 1, 1601059230),
(10, 'About Officeyew', 'home_page_about', '<p><em><strong>Lorem ipsum</strong></em> dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Quis ipsum suspendisse ultrices gravida. Risus commodo viverra maecenas accumsan lacus vel facilisis.</p>\r\n', 'About us on home page', '', '', 1, 1599746124),
(11, 'Contact Us', 'contact_us', '<h1><strong>Contact Us</strong></h1>\r\n\r\n<p>We wanted to create the largest &ldquo;One stop shop&rdquo; for everything office furniture. We created officeyew to help make buying and selling of office furniture easy , by making it quicker, simpler, and more fun - and with over million of downloads and millions of listings each year, not only is Officeyew the only office furniture specific app of its kind, it is also the fastest growing office furniture marketplace in the USA or World. Listing what you do not need with the snap of a photo and finding what you want anywhere in the USA does not just help you buy and sell more - it helps you live more. (Plus, its easy and free, everyone loves free) Selling on Officeyew is effortless, making it easy to post free classified ads and browse new and used goods for sale. Officeyew will be the &ldquo;The one stop shop&rdquo; for everything Office Furniture. Not only can you buy and sell office furniture, you can find and installer, find a designer and look for employment or an employee.</p>\r\n', ' ', '', '', 1, 1601436203);
