(29, '68-1606407445', 68, 'Key board', 0, 500, ' CORSECA', 2018, 'No', 3, 1, '', 'Stylish Ultra-Slim design Keyboard & Mouse, Sealed membrane for overall protection, Brush metal finish, Advanced controls 2.4G wireless technology with 10m working range and nano-receiver, Energy saving design standby function Multimedia Keyboard 104 keys + 8 hot keys, High-Quality soft and silent keys, Easy cleaning flat-square design keys, Ultra-durable UV-ink printed keys Professional Optical sensor with direct DPI switch 800/1200/1600 dpi, High quality switches for over 2 million clicks supported Smooth responsive cursor control with easy scrolling, Designed for professional or gaming use\r\n', '29_pro_1606407445_20841.PNG', 1, 1606407445, 1607074503),
(30, '68-1606408115', 68, 'Monitor', 0, 3000, ' OmniTechRetail', 2018, 'No', 6, 3, '', 'Bring home this amazing LG monitor and enjoy a never-before visual experience on its 54.61-cm (21.5) Full HD IPS display. You can enjoy seamless motion, with minimal screen tearing and stuttering, while playing fast and graphic-rich games, thanks to the Radeon FreeSync technology. This monitor comes with thin bezels on three of its sides so you can enjoy an immersive viewing experience. The Dynamic Action Sync mode of this LG monitor helps reduce input lag so you won’t miss out on any action.\r\n\r\n', '30_pro_1606408115_78755.PNG', 1, 1606408115, 1606408115),
